import React from 'react';

import {
  Container,
  Info,
  InfoText,
  InfoButton,
  InfoButtonIcon,
  Image,
} from './styles';

const Index: React.FC = () => {
  return (
    <Container>
      <Info>
        <InfoText>Encontre dados do Covid-19 em Sergipe</InfoText>
        <InfoButton>
          Ver Dados
          <InfoButtonIcon />
        </InfoButton>
      </Info>
      <Image />
    </Container>
  );
};

export default Index;
